// client/src/components/AdminDashboard.js
import React from 'react';

const AdminDashboard = () => {
  // This component will fetch and display shield information for all users
  return (
    <div>
      <h2>Admin Dashboard</h2>
      <p>Here you can view all users' shields and their expiry times.</p>
    </div>
  );
};

export default AdminDashboard;
